import React from 'react';
/* import {FiLinkedin, FiGithub, FiInstagram, FiFacebook} from 'react-icons/fi'; */
import {InfoContainer, InfoText, InfoTitle, Infos} from './InfoElements';

const Info = () => {
  return (
    <>
    <InfoContainer id='about'>
    <InfoText>
        <InfoTitle>
            My story
        </InfoTitle>
        <Infos>
        I'm currently a student in the last year 
        at the informatics' University of Turin.
        Really passionate about web developing and,
        particularly, front-end.
        I have learned how to use many different technologies 
        and still learning everyday. I love working individually 
        as well as within a team.
        If this sounds interesting to you, contact me!
        </Infos>
    </InfoText>
{/*     <ContactsWrapper>
    <FiLinkedin />
    <FiGithub />
    <FiInstagram />
    <FiFacebook />
    </ContactsWrapper> */}
    </InfoContainer>
    </>
  );
};

export default Info;
